import React from 'react';
import './DoctorCard.css';

export default function DoctorCard({ doctor }) {
  return (
    <div className="doctor-card">
      {doctor.image && (
        <img
          src={`/uploads/${doctor.image}`}
          alt={doctor.name}
          className="doctor-image"
          onError={(e) => (e.target.style.display = 'none')} // hide broken images
        />
      )}
      <h3 className="doctor-name">{doctor.name}</h3>
      <p className="doctor-specialization">{doctor.specialization || 'N/A'}</p>
      <p className="doctor-location">{doctor.location || 'Location not specified'}</p>
      <p className="doctor-rating">Rating: {doctor.rating || 0}</p>
    </div>
  );
}
